import React from "react";
import ReactDOM from "react-dom";

const Header = props => <h1>{props.course}</h1>;

const Part = props => (
  <p>
    {props.partName} {props.partExercises}
  </p>
);

const Content = props => (
  <div>
    <Part partName={props.parts[0]} partExercises={props.exercises[0]} />
    <Part partName={props.parts[1]} partExercises={props.exercises[1]} />
    <Part partName={props.parts[2]} partExercises={props.exercises[2]} />
  </div>
);

const Total = props => (
  <p>
    yhteensä {props.exercises[0] + props.exercises[1] + props.exercises[2]}{" "}
    tehtävää
  </p>
);

const App = () => {
  const course = 'Half Stack -sovelluskehitys'
  const part1 = {
    name: 'Reactin perusteet',
    exercises: 10
  }
  const part2 = {
    name: 'Tiedonvälitys propseilla',
    exercises: 7
  }
  const part3 = {
    name: 'Komponenttien tila',
    exercises: 14
  }

  return (
    <div>
      <Header course={course} />
      <Content
        parts={[part1, part2, part3]}
      />
      <Total parts={[part1, part2, part3]} />
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
